import React, { Component } from 'react'
import imageWriterDay from '../img/Kolas.jpg' // relative path to image 

export default class WriterDay extends Component {
    render() {
        return (
                <div class="container">
                    <h1 class="jumbotron-heading">Деятель дня</h1>
                    <p class="lead text-muted">
                        Целью создания данного портала является, чтобы вы могли изучить и узнать
                        что-то новое о белорусских поэтах.
                    </p>
                    <img src={imageWriterDay} height="200px"></img>
                </div>
        );
    }
}
